	position: absolute;
	left: 0px;
	height: 20px;
}
label[for=no] {
	position: absolute;
	right: 0px;
}
#no {
	&:checked {
		& ~ .switch {
			background: #ff3b30;
			span {
				background: #fff;
				margin-left: -8px;
				&:after {
					background: #fff;
					height: 20px;
